import React, {Component} from "react";
import {FlatList, Text, View} from 'react-native';

const meuFlatList = () =>
<View style={{flex:1, paddingTop:22}}>
    <FlatList
        data={
            [
                {nome:'Jefferson', key:1},
                {nome:'Vilnei', key:2},
                {nome:'Neto', key:3},
                {nome:'Lana', key:4},
                {nome:'Lívia', key:5},
                {nome:'Lucas', key:6},
                {nome:'Luis', key:7},
                {nome:'Marcio', key:8},
                {nome:'Marcos', key:9},
                {nome:'Maria', key:10}
            ]
        } 

        renderItem={
            ({item})=>{
                return (
                    <Text style={{padding:15, fontSize: 18}}>
                        {item.nome}
                    </Text>
                )
            }
        }

    />
</View>

export default meuFlatList
